function uploadCSV(){$("#upload").on("submit",function(e){e.preventDefault(),e.stopPropagation();var a=new FormData,o=$("#file")[0].files[0];if("undefined"==typeof o)return alert("Please select a file to upload");a.append("file",o);var t=$.ajax({type:"post",url:"/home/upload",data:a,processData:!1,contentType:!1});t.done(function(e){alert("File uploaded!"),$(".container").replaceWith(e)}),t.fail(function(e){alert(e.responseText),console.log(e)})})}